collections = () => {
    document.getElementById('collections').innerHTML = JSON.parse(localStorage.getItem('colors')).map((element, index) => {
        return ('<div class="col col-lg-3 col-md-4 col-sm-12"><div style="background-color:' + element[0] + '" id="' + element[0] + '" onclick="copy(this.id)"><span class="' + element[0] + '">' + element[0] + '</span></div> <div style="background-color:' + element[1] + '" id="' + element[1] + '" onclick="copy(this.id)"><span class="' + element[1] + '">' + element[1] + '</span></div> <div style="background-color:' + element[2] + '" id="' + element[2] + '" onclick="copy(this.id)"><span class="' + element[2] + '">' + element[2] + '</span></div> <div onclick="unsave(' + index + ')">Saved <i class="fa fa-bookmark" style=" background-image: repeating-linear-gradient(45deg, violet, indigo, blue, green, yellow, orange, red, violet);-webkit-background-clip: text;-webkit-text-fill-color: transparent;"></i></div></div>')
    }).join(" ");
}

uploadimage = () => {
    if (!window.EyeDropper) {
        document.getElementById('error').innerHTML = 'Your browser does not support the EyeDropper API';
    } else {
        let input = document.getElementById('upload');
        let reader = new FileReader()
        reader.readAsDataURL(input.files[0])
        reader.addEventListener('load', () => {
            document.getElementById('upload-image').innerHTML = `<div class='col'><div class="image-area mt-4"><img id="imageResult" src="${reader.result}" alt="" class="img-fluid rounded shadow-sm mx-auto d-block"></div></div><div class='col'><button class='btn btn-success btn-sm' onclick='openeyedropper()'>select color</button></div><div class='col colorholder'></div>`;
        })
    }
}

openeyedropper = () => {
    const eyeDropper = new EyeDropper();
    eyeDropper.open().then(result => {
        let color = document.getElementsByClassName('colorholder')[0];
        let span = document.createElement('span');
        span.style.backgroundColor = result.sRGBHex;
        span.setAttribute('id', result.sRGBHex)
        span.setAttribute('class', result.sRGBHex)
        span.addEventListener('click', () => {
            copy(result.sRGBHex);
        })
        span.innerText = result.sRGBHex;
        color.appendChild(span);
    }).catch(e => {
        console.log("error:", e);
    });
}

copy = (id) => {
    navigator.clipboard.writeText(id);
    document.getElementsByClassName(id)[0].innerHTML = '!copied';
    setTimeout(() => {
        document.getElementsByClassName(id)[0].innerHTML = id;
    }, 1000);
}

save = (c1, c2, c3) => {
    if (localStorage.getItem('colors') == null) {
        localStorage.setItem('colors', '[]');
    }
    let colors = JSON.parse(localStorage.getItem('colors'));
    colors.push([c1, c2, c3]);
    localStorage.setItem('colors', JSON.stringify(colors));
}

unsave = (index) => {
    let colors = JSON.parse(localStorage.getItem('colors'))
    colors.splice(index, 1);
    localStorage.setItem('colors', JSON.stringify(colors));
    collections();
}

